import React, { Component } from 'react';

class MyFixation extends Component {
  render() {
    return (
    <div>
      <h1>Jeazi Ricardo</h1>
      <p>Eu sou uma pessoa bem legal!</p>
    </div>
    )
  }
}

export default MyFixation;
